       <Container >
           <Row className="row">
                <div className="column">
                    <div className="card">
                        <h3>Card 1</h3>
                        <p>Text</p>
                        <p>Some text</p>
                    </div>
                </div>

           </Row>

       </Container>
    )

}


export default GamesCards;
